webpackJsonp([0xdeb5380fd9df],{7184:function(e,t){e.exports={data:{post:{html:'<p><a title="taz 14.12.04 Tötet jede Geschmacksknospe" href="http://www.taz.de/pt/2004/12/14/a0214.nf/text">taz: Tötet jede Geschmacksknospe!</a> "Norweger in aller Welt essen zu Weihnachten Lutefisk - einen grauenhaften Stinkfisch" (Kills every taste bud! Norwegians in the entire world at Christmas eat lutefisk - a horrible stinkfish) Smells like home to me... </p>\n<p>The article also cites the <a href="http://groups.google.de/groups?selm=3bt4kg%245uh%40bdt.bdt.com">Clay Shirky taste test</a>: "If you can taste the difference between caviar on a cracker and ketchup on a Kit-Kat while blindfolded, you have not had enough aquavit to be ready for lutefisk." </p>\n<p>Mama says she\'ll serve lutefisk and aquavit to my father, but only without the lutefisk.</p>',fields:{title:"Kills Every Taste Bud",date:"23 Dec 2004",url:"https://papascott.de/2004-12-23-toetet-jede-geschmacksknospe/"}}},pathContext:{slug:"/2004-12-23-toetet-jede-geschmacksknospe/",prev:{fields:{title:"Interesting Times",date:"22 Dec 2004",slug:"/2004-12-22-interesting-times/"}},next:{fields:{title:"Earlier and Earlier",date:"25 Dec 2004",slug:"/2004-12-25-earlier-and-earlier/"}}}}}});
